	    if (this.value && !_.isDate(this.value)) {
	      this.value = new Date(this.value);
	    }
	
	    //Set default date
	    if (!this.value) {
	      var date = new Date();
	      date.setSeconds(0);
	      date.setMilliseconds(0);
	
	      this.value = date;
	    }
	
